import { useState } from "react"

import "./form.css"

function Form(){
    const [val,setval]=useState(" ")
    const [email,emailsetval]=useState("")
    return(
        <>
        <form>

            <label>Enter your name:
            <input type='text' value={val} onChange={(e)=> setval (e.target.val)} /> 
            </label>

            
            <label>Enter your Email:
            <input type='text' value={email} onChange={(e)=> emailsetval (e.target.val)} /> 
            </label>

        </form>
        </>
    )
}

export default Form;
